  useEffect(() => {
    fetch(
      "https://newsapi.org/v2/everything?q=bitcoin&apiKey=c1f5ee1b3c6243e68cf3e091245df259"
    )
      .then((response) => response.json())
      .then((data) => console.log(data));
  });
    const getNews = async () => {
      const res = await fetch(
        "https://newsapi.org/v2/top-headlines?country=ng&apiKey=f2b12a6becc84f6cb6fbbc38d0f8e957"
      );
      const data = await res.json();
      this.setState({ news: data.articles, loading: false });
    };
